B.DS=A.a(s([1116352408,1899447441,3049323471,3921009573,961987163,1508970993,2453635748,2870763221,3624381080,310598401,607225278,1426881987,1925078388,2162078206,2614888103,3248222580,3835390401,4022224774,264347078,604807628,770255983,1249150122,1555081692,1996064986,2554220882,2821834349,2952996808,3210313671,3336571891,3584528711,113926993,338241895,666307205,773529912,1294757372,1396182291,1695183700,1986661051,2177026350,2456956037,2730485921,2820302411,3259730800,3345764771,3516065817,3600352804,4094571909,275423344,430227734,506948616,659060556,883997877,958139571,1322822218,1537002063,1747873779,1955562222,2024104815,2227730452,2361852424,2428436474,2756734187,3204031479,3329325298]),t.t)
B.DT=A.a(s(["  Yar\u0131\u015fmac\u0131n\u0131n her iki veya bir aya\u011f\u0131 da s\u0131n\u0131r \xe7izgisini ge\xe7ti\u011finde 'Gam-jeom' ilan edilir. E\u011fer ayak parma\u011f\u0131n\u0131n k\xf6k k\u0131sm\u0131 s\u0131n\u0131r \xe7izgisinin d\u0131\u015f\u0131na  dokunuyorsa  ve yar\u0131\u015fmac\u0131n\u0131n ayak taban\u0131 s\u0131n\u0131r \xe7izgisinin \xfczerinde ise, d\u0131\u015far\u0131 \xe7\u0131km\u0131\u015f say\u0131l\u0131r. Aya\u011f\u0131n izd\xfc\u015f\xfcm\xfc s\u0131n\u0131r \xe7izgisi d\u0131\u015f\u0131nda olmas\u0131 durumunda aya\u011f\u0131n d\u0131\u015far\u0131ya basmas\u0131 esas al\u0131n\u0131r.\n\n E\u011fer bir m\xfcsab\u0131k rakip m\xfcsab\u0131k taraf\u0131ndan yasak bir hareket sonucunda s\u0131n\u0131r \xe7izgisini ge\xe7erse 'Gam-jeom' verilmemelidir.\n\n E\u011fer chung(mavi k\xf6\u015fe) hong(k\u0131rm\u0131z\u0131 k\xf6\u015fe)\u2019u s\u0131n\u0131r \xe7izgisinin d\u0131\u015f\u0131na atar ve d\u0131\u015far\u0131da iken teknik uygularsa , Gam-jeom ile cezaland\u0131r\u0131l\u0131r ve ald\u0131\u011f\u0131 puanlar ge\xe7ersiz say\u0131l\u0131r.\n\n","  D\xfc\u015fen bir rakibin tan\u0131m\u0131: sporcunun ayak tabanlar\u0131 d\u0131\u015f\u0131nda herhangi bir v\xfccut k\u0131sm\u0131n\u0131n yere de\u011fmesine d\xfc\u015fme denir. Yere d\xfc\u015fme i\xe7in 'Gam-jeom' ilan edilir.\n\n T\xfcm teknik \xe7arp\u0131\u015fmalarda  iki sporcunun d\xfc\u015fmesi durumunda \u201cGam-jeom\u201d ile cezaland\u0131r\u0131lmaz.\n\n Tekniksiz v\xfccutla \xe7arp\u0131\u015fmalarda, kaval kemiklerinin bir birleriyle \xe7arp\u0131\u015fmas\u0131 halinde  iki sporcunun d\xfc\u015fmesi durumunda m\xfcsabaka devam eder. Gam-jeom cezas\u0131 verilmez.\n\n Dengesi bozulup kendili\u011finden d\xfc\u015fmesi durumunda 'Gam-jeom' ile cezaland\u0131r\u0131l\u0131r.\n\n","  Bu eylem hi\xe7bir sald\u0131r\u0131 niyeti olmadan duraksamay\u0131 i\xe7erir. S\xfcrekli olarak hareketsiz bir stil sergileyen m\xfcsab\u0131ka ceza verilmelidir. E\u011fer her iki m\xfcsab\u0131k be\u015f (5) saniyeden sonra pasif kal\u0131rsa orta hakem 'D\xf6v\xfc\u015f' komutunu bildirmelidir. Verilen komuttan be\u015f (5) saniye sonra, orijinal pozisyonundan geriye do\u011fru hareket ederek m\xfcsab\u0131ka \u201cGam-jeom\u201d cezas\u0131 verilir. Verilen komuttan be\u015f (5) saniye sonra her iki m\xfcsab\u0131kta da aktivite yoksa ikisine de 'Gam-jeom' cezas\u0131 verilmelidir.\n\n Rakibin ata\u011f\u0131ndan ka\xe7\u0131nmak i\xe7in s\u0131rt\u0131 d\xf6nmek, fair-play ruhunun eksikli\u011fini ifade etti\u011fi ve ciddi yaralanmalara sebep olabilece\u011fi i\xe7in cezaland\u0131r\u0131lmal\u0131d\u0131r. Ayn\u0131 ceza ayr\u0131ca bel seviyesinin alt\u0131na e\u011filerek veya \xe7\xf6melerek rakibin ata\u011f\u0131n\u0131 savu\u015fturma i\xe7in de verilmelidir.\n\n 'Sakatlanm\u0131\u015f numaras\u0131 yapmak' sakatl\u0131\u011f\u0131 abartma veya rakibin hareketlerini bir ihlal olarak g\xf6stermek maksad\u0131yla darbeye maruz kalmayan bir  v\xfccut k\u0131sm\u0131nda ac\u0131 belirtmek ve ayr\u0131ca zaman ge\xe7irmek amac\u0131yla ac\u0131y\u0131 abartmak demektir. Bu durumda hakem 'Gam-jeom' cezas\u0131 vermelidir.\n\n","  Bu hareket rakibin y\xfcksek yaralanma olas\u0131l\u0131\u011f\u0131 nedeniyle \xe7ok tehlikelidir. Tehlike \u015fundan kaynaklan\u0131r:\n\n D\xfc\u015fen rakip derhal savunmas\u0131z bir durumdad\u0131r.\n\n D\xfc\u015fm\xfc\u015f bir m\xfcsab\u0131ka vuran herhangi bir tekni\u011fin etkisi m\xfcsab\u0131k\u0131n pozisyonu nedeniyle daha b\xfcy\xfck olacakt\u0131r. D\xfc\u015fm\xfc\u015f bir rakibe kar\u015f\u0131 bu t\xfcr agresif  hareketler Taekwondo yar\u0131\u015fmas\u0131na uygun olmad\u0131\u011f\u0131 gibi Taekwondo ruhuyla da uyumlu de\u011fildir. Bu ba\u011flamda, d\xfc\u015fen rakibe kas\u0131tl\u0131 vurma i\xe7in cezalar darbenin etki derecesine bak\u0131lmaks\u0131z\u0131n verilmesi gerekir.\n\n D\xfc\u015fen rakibe sald\u0131r\u0131da temas olsun veya olmas\u0131n (k\xf6t\xfc niyetli ise) ceza verilmelidir.\n\n E\u011fer sporcu rakibi yere de\u011fmeden puan al\u0131rsa, puan kal\u0131r d\xfc\u015fen sporcuya Gam-Jeom verilir.\n\n Sporcu rakibi yere temas ettikten sonra puan al\u0131rsa, puanlar silinir ve d\xfc\u015fen rakibe sald\u0131rmadan dolay\u0131 rakibe de yere d\xfc\u015fmeden dolay\u0131 birer Gam-Jeom verilir.\n\n","  ","  ","  ","  ","  ","  ","  ","  "]),t.s)
