B.Ef=A.a(s(["\t  Palding, orta seviyeye uygulanan bir tekniktir. Bu tekni\u011fin uygulanmas\u0131 i\xe7in aya\u011f\u0131n \xfcst k\u0131sm\u0131 kullan\u0131l\u0131r. Tekni\u011fin amac\u0131, kal\xe7an\u0131n ileri do\u011fru itilmesi ve dizin \xe7ekilmesiyle birlikte, en k\u0131sa mesafeden rakibin g\xf6vde b\xf6lgesine y\xf6nelik bir vuru\u015f yapmakt\u0131r.\n\n\t Vuru\u015f yeri aya\u011f\u0131n \xfcst k\u0131sm\u0131d\u0131r ve uygulama s\u0131ras\u0131nda di\u011fer bacak hafif\xe7e dizden k\u0131r\u0131l\u0131r. Ba\u015f hafif\xe7e \xf6ne e\u011filirken, v\xfccut geriye yatar ve dengenin (a\u011f\u0131rl\u0131k merkezinin) \xf6ne do\u011fru kayd\u0131r\u0131lmas\u0131 hedeflenir. Kollar, yumruklar s\u0131k\u0131 bir \u015fekilde \xf6ne uzat\u0131l\u0131r.\n\n\t Teknik uygulan\u0131rken, diz yukar\u0131 kalkmadan h\u0131zla ileri kayarak, ayak a\u015fa\u011f\u0131dan yukar\u0131 do\u011fru hedefi bulur. Vuru\u015f, genellikle rakibin dirsek alt\u0131 yan bo\u015fluklar\u0131 ve alt kar\u0131n seviyesi gibi orta seviyede (momtong) yap\u0131l\u0131r. Teknik genellikle arkadaki ayakla uygulan\u0131r. Vuru\u015f s\u0131ras\u0131nda v\xfccut, belden aksi y\xf6ne do\u011fru biraz \xe7evrilir ve vuru\u015f g\xfcc\xfc art\u0131r\u0131l\u0131rken, denge sa\u011flan\u0131r.\n\n\t Ba\u015f, hedefe tamamen d\xf6n\xfck konumda olmal\u0131d\u0131r. Teknik, b\xfct\xfcn v\xfccuttan, belden ve kal\xe7adan \xe7\u0131kart\u0131larak vuru\u015f h\u0131z\u0131 ve kuvveti art\u0131r\u0131l\u0131r. Teknik, rakibin tam kar\u015f\u0131s\u0131nda v\xfccut geriye yat\u0131r\u0131larak veya yana biraz kayarak uygulan\u0131r. Mesafe kontrol\xfc, step ad\u0131mlar\u0131 ile ayarlan\u0131r.\n\n\t Vuru\u015f i\xe7in zamanlama, be\u015f \u015fekilde yap\u0131labilir:\n\n\t1-Rakibin ata\u011f\u0131n\u0131 beklemeden direkt vuru\u015f\n\n\t2-Rakibin tekni\u011fi yar\u0131da iken vuru\u015f\n\n\t3-Rakibin tekni\u011fi vuru\u015f an\u0131nda iken vuru\u015f\n\n\t4-Rakibin tekni\u011fi ba\u015flang\u0131\xe7 an\u0131na geldi\u011fi zaman vuru\u015f\n\n\t5-Rakip tekni\u011fini geri \xe7ekerken vuru\u015f\n\n","\t  Dollyo-chagi, Taekwondo m\xfcsabakalar\u0131nda s\u0131kl\u0131kla kullan\u0131lan bir tekni\u011fe sahiptir. Bu tekni\u011fin vuru\u015f b\xf6lgesi genellikle y\xfcksek seviyededir ve aya\u011f\u0131n \xfcst k\u0131sm\u0131yla yap\u0131l\u0131r. Vuru\u015f i\xe7in kal\xe7a ileri do\u011fru itilir ve diz \xe7ekilerek ayak, en k\u0131sa mesafeden rakibin kafa b\xf6lgesine do\u011fru dairesel bir hareketle vurulur.\n\n\t Bu tekni\u011fin uygulanmas\u0131 i\xe7in ayak dizden k\u0131r\u0131larak \xf6ne do\u011fru dairesel bir tekmeye verilir. Di\u011fer bacak hafif\xe7e dizden k\u0131r\u0131l\u0131r ve ba\u015f hafif\xe7e \xf6ne e\u011filirken kollar da yumruklar s\u0131k\u0131 bir \u015fekilde \xf6ne do\u011fru uzat\u0131l\u0131r. Vuru\u015f yeri aya\u011f\u0131n ap-chuck (pen\xe7e) k\u0131sm\u0131d\u0131r. Teknik uygulan\u0131rken \xf6nce diz kalkar ve ard\u0131ndan h\u0131zl\u0131ca ayak a\xe7\u0131l\u0131r. Bu iki hareket birbirini takip etti\u011fi i\xe7in tek bir hareket gibi g\xf6r\xfcnmelidir.\n\n\t Dollyo-chagi genellikle y\xfcksek seviyede yap\u0131l\u0131r, ancak vuru\u015f yap\u0131lacak yere g\xf6re de\u011fi\u015febilir. Teknik \xf6ndeki veya arkadaki ayakla yap\u0131labilir. Vuru\u015f s\u0131ras\u0131nda v\xfccut, belden aksi y\xf6ne do\u011fru \xe7evrilerek vuru\u015f g\xfcc\xfc artt\u0131r\u0131l\u0131r ve denge sa\u011flan\u0131r. Ba\u015f tamamen hedefe d\xf6n\xfck konumda olmal\u0131d\u0131r.\n\n\t Di\u011fer tekniklerden farkl\u0131 olarak, pe\u015fpe\u015fe birden fazla vuru\u015f yap\u0131labilir ve ap-chagi veya yeop-chagi vuru\u015fu yapan ayak yerine gitmeden dollyo-chagi vuru\u015fu da yap\u0131labilir. Ayr\u0131ca vuru\u015flar s\u0131ras\u0131nda aya\u011f\u0131n \xfcst (palding) k\u0131sm\u0131 da kullan\u0131labilir.\n\n","\t  ApChagi, Taekwondo'nun temel tekniklerinden biridir ve m\xfcsabakalarda s\u0131k\xe7a kullan\u0131lan bir tekni\u011fe sahiptir. 'Ap' kelimesi '\xf6n' veya '\xf6n taraf' anlam\u0131na gelir, 'chagi' ise 'tekme' anlam\u0131na gelir.\n\n\t ApChagi, aya\u011f\u0131n ayak bile\u011fi veya ayak bile\u011fi \xfczerindeki topuk k\u0131sm\u0131 kullan\u0131larak yap\u0131lan bir tekmedir. Teknik, d\xfcz bir \xe7izgi \xfczerinde ve h\u0131zl\u0131 bir \u015fekilde ileriye do\u011fru hareket ederken rakibe yap\u0131lan bir tekmedir. Ayak, h\u0131zl\u0131 ve kontroll\xfc bir \u015fekilde d\xfc\u015f\xfcr\xfcl\xfcr ve aya\u011f\u0131n \xf6n k\u0131sm\u0131 h\u0131zla rakibin hedef b\xf6lgesine do\u011fru hareket ettirilir. Teknik genellikle kar\u015f\u0131 taraf\u0131n g\xf6\u011f\xfcs veya kar\u0131n b\xf6lgesine yap\u0131l\u0131r.\n\n\t ApChagi, di\u011fer tekniklere g\xf6re daha h\u0131zl\u0131 ve daha do\u011fru bir \u015fekilde yap\u0131labilir. Vuru\u015fu yapmak i\xe7in aya\u011f\u0131n geriye do\u011fru \xe7ekilmesi gerekmez, bu nedenle teknik h\u0131zl\u0131 bir \u015fekilde ard\u0131\u015f\u0131k olarak uygulanabilir. Ayr\u0131ca, ApChagi'nin uygulanmas\u0131 s\u0131ras\u0131nda di\u011fer bacak da hafif\xe7e dizden k\u0131r\u0131l\u0131r, bu da dengeyi sa\u011flar.\n\n\t M\xfcsabakalarda ApChagi, genellikle rakibin defans\u0131n\u0131 a\xe7mak ve skor yapmak i\xe7in kullan\u0131l\u0131r. Ayr\u0131ca, rakibin savunmas\u0131n\u0131 ge\xe7mek i\xe7in di\u011fer tekniklerle birlikte de kullan\u0131labilir.\n\n","\t  Yeop Chagi, yani yan tekme vuru\u015f tekni\u011fi, taekwondo m\xfcsabakalar\u0131nda olduk\xe7a yayg\u0131n olarak kullan\u0131lan bir tekniktir. Bu teknikte, vuru\u015f b\xf6lgesi rakibin g\xf6vdesinin yan k\u0131sm\u0131d\u0131r. Vuru\u015fun ba\u015flang\u0131c\u0131, ayak taban\u0131n\u0131n 90 derecelik bir a\xe7\u0131yla yana do\u011fru d\xf6nd\xfcr\xfclmesiyle ger\xe7ekle\u015fir. Bu d\xf6n\xfc\u015f hareketi, bel ve g\xf6vdeden kazan\u0131lan momentum ile desteklenir.\n\n\t Yeop Chagi vuru\u015funda, aya\u011f\u0131n d\u0131\u015f kenar\u0131 ve topuktan destek al\u0131narak rakibin g\xf6\u011fs\xfcne hamle yap\u0131l\u0131r. Bu teknik, rakibi h\u0131zl\u0131 ve etkili bir \u015fekilde etkisiz hale getirmek i\xe7in kullan\u0131labilir. Ayn\u0131 zamanda, bu teknikle rakibin denge noktalar\u0131na y\xf6nelik hassas bir vuru\u015f ger\xe7ekle\u015ftirilerek rakibin savunmas\u0131n\u0131n k\u0131r\u0131lmas\u0131 hedeflenir.\n\n\t Yeop Chagi tekni\u011fi, taekwondo sporcular\u0131n\u0131n kuvvet, h\u0131z ve denge becerilerini geli\u015ftirmelerine de yard\u0131mc\u0131 olabilir. Bu teknik, ayn\u0131 zamanda taekwondo m\xfcsabakalar\u0131nda \xf6nemli bir puanlama arac\u0131 olarak da kullan\u0131l\u0131r.\n\n","\t  Dwi Chagi tekni\u011fi, rakibe kar\u015f\u0131 orta seviye bir vuru\u015f yapmak i\xe7in kullan\u0131l\u0131r. Bu teknikte, ayak topu\u011fu kullan\u0131larak geriye do\u011fru bir hareketle rakibin g\xf6vde b\xf6lgesine vuru\u015f yap\u0131l\u0131r. DwiChagi tekni\u011fi, ayn\u0131 zamanda geriye d\xf6n\xfck tekme olarak da bilinir.\n\n\t Bu tekni\u011fin temelinde, rakibe yakla\u015f\u0131p vuru\u015f yaparken ani bir geri \xe7ekilme ve ard\u0131ndan h\u0131zl\u0131 bir ileri at\u0131l\u0131m yatar. Ayak topu\u011fu kullan\u0131larak geriye do\u011fru bir hareket yap\u0131ld\u0131ktan sonra, rakibe do\u011fru bir atak i\xe7in ayak taban\u0131 kullan\u0131l\u0131r. Vuru\u015f h\u0131z\u0131 ve g\xfcc\xfc, geriye \xe7ekilme ve ard\u0131ndan h\u0131zl\u0131 bir ileri at\u0131l\u0131m ile kazan\u0131l\u0131r.\n\n\t Di\u011fer taekwondo tekniklerinden farkl\u0131 olarak dwit chagi tekni\u011fi d\xf6nerli tekmelerden birisidir.  Bu tekmeler rotasyonlu bir \u015fekilde at\u0131l\u0131rsa extra olarak 2 puan kazand\u0131r\u0131r.\n\n\t Dwi Chagi tekni\u011fi, Taekwondo'nun dinamik ve g\xfc\xe7l\xfc bir spor dal\u0131 olmas\u0131na katk\u0131da bulunur. Tekni\u011fin uygulanmas\u0131 s\u0131ras\u0131nda, sporcu dengesini korumal\u0131 ve rakibin tepkilerini takip etmeli, do\u011fru zamanda uygun \u015fekilde vuru\u015f yaparak ma\xe7\u0131 kazanmak i\xe7in avantaj sa\u011flamal\u0131d\u0131r.\n\n","\t  Bande Dollyo tekni\u011fi, taekwondo'da kullan\u0131lan yar\u0131m dairesel tekme tekniklerinden biridir. Bu teknikte, ayak dizden k\u0131r\u0131larak yana do\u011fru (180) bir a\xe7\u0131yla hareket ettirilir.\n\n\t Teknik i\xe7in di\u011fer bacak hafif\xe7e dizden k\u0131r\u0131l\u0131rken, ba\u015f hafif\xe7e \xf6ne e\u011filir ve kollar yumruklar s\u0131k\u0131larak biraz \xf6ne uzan\u0131r. Vuru\u015f yeri olarak topuk, taban veya ayak pen\xe7esi kullan\u0131labilir.\n\n\t Bande Dollyo tekni\u011fi, dizin kalk\u0131\u015f\u0131 ve dizden yar\u0131m dairesel a\xe7\u0131l\u0131\u015f \u015feklinde iki hareketin birle\u015fiminden olu\u015fur ve bu iki hareket \xe7ok h\u0131zl\u0131 yap\u0131larak bir hareketmi\u015f gibi g\xf6r\xfcn\xfcr. Vuru\u015f momtong veya olgul seviyesinde yap\u0131labilir ve \xf6ndeki veya gerideki ayak kullan\u0131labilir.\n\n\t Baca\u011f\u0131n yar\u0131m dairesel d\xf6n\xfc\u015f\xfcne bel d\xf6n\xfc\u015f\xfc eklenerek vuru\u015f g\xfcc\xfc artt\u0131r\u0131labilir. Hedef vuru\u015f yapan aya\u011f\u0131n taraf\u0131ndad\u0131r ve ba\u015f vuru\u015f yapan tarafa \xe7evrilir. BandeDollyo tekni\u011fi, do\u011fru bir \u015fekilde uyguland\u0131\u011f\u0131nda olduk\xe7a etkili bir tekme olabilir. Savunma ve sald\u0131r\u0131 ama\xe7lar\u0131 i\xe7in kullan\u0131labilir.\n\n"]),t.s)
